import os


def file_path(file_dir):
    for root, dirs, files in os.walk(file_dir):
        print(root)  # 当前目录路径
        print(dirs)  # 当前路径下所有子目录
        print(files)  # 当前路径下所有非目录子文件


if __name__ == '__main__':
    file_path('D:\\PycharmProjects\\Python_Learning\\Python_Learning')


def main():
    # read data for n sequences
    n = int(input())
    s = input()
    t = input()

    # solve
    if s == t:
        print(0)
    else:
        # create a dictionary to store the number of occurrences of each character
        d = {}
        for i in range(n):
            if s[i] in d:
                d[s[i]] += 1
            else:
                d[s[i]] = 1
            if t[i] in d:
                d[t[i]] -= 1
            else:
                d[t[i]] = -1
        flag = True
        for key in d:
            if d[key] != 0:
                flag = False
                break
        if flag:
            i = 0
            j = 0
            count = 0
            while i < n and j < n:
                if s[i] == t[j]:
                    i += 1
                    j += 1
                else:
                    i += 1
                    count += 1
            print(count)
            i = 0
            j = 0
            while i < n and j < n:
                if s[i] == t[j]:
                    i += 1
                    j += 1
                else:
                    print(i, end=' ')
                    i += 1
                    count += 1
        else:
            print(-1)

main()
